// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Contact {
    address public owner;
    string[] public names;
    string[] public mobiles;
    string[] public emails;
    string[] public organizations;
    mapping(string => bool) private _contacts;

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(owner == msg.sender, "Not authorized");
        _;
    }

    function insertContact(
        string memory name,
        string memory mobile,
        string memory email,
        string memory org
    ) public onlyOwner {
        require(!_contacts[mobile], "Contact already exists");
        names.push(name);
        mobiles.push(mobile);
        emails.push(email);
        organizations.push(org);
        _contacts[mobile] = true;
    }

    function viewContacts() 
        public 
        view 
        returns (
            string[] memory,
            string[] memory,
            string[] memory,
            string[] memory
        ) 
    {
        return (names, mobiles, emails, organizations);
    }
}
